import React from "react";
import "./styles.css";
const imgsrc =
  "data:image/jpeg;base64,";
const script1 = document.createElement("script");
script1.src = "https://kit.fontawesome.com/a076d05399.js";
script1.async = true;
document.body.appendChild(script1);
class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      startTimer: true,
      completed: 100,
      correct: 90,
      topics: [
        "All Topics",
        "Algebra",
        "Geometry",
        "Trignometry",
        "Arithmetic"
      ],
      showTopics: false,
      filters: [
        { name: "Calculator", content: ["All", "Calculator", "No Calculator"] },
        { name: "Answear Type", content: ["All", "Mutiple Choice", "Grid In"] },
        { name: "Ans Type", content: ["All", "Contains Chart", "No Chart"] },
        { name: "Problem Length", content: ["All", "Short", "No Long"] }
      ],
      showFilters: false,
      accuracy: 0,
      circleBG:
        "linear-gradient(-90deg,#878787 50%,transparent 50%),linear-gradient(-90deg,#7efff9 ,#62afb1 50% ,#878787 50%)",
      showPopular: false,
      popular: [
        { course: "All Topics", subject: [] },
        { course: "Algebra", subject: ["Subject1", "Subject2", "Subject3"] },
        { course: "Geometry", subject: ["Subject1", "Subject2", "Subject3"] },
        {
          course: "Trignometry",
          subject: ["Subject1", "Subject2", "Subject3"]
        },
        { course: "Arithmetic", subject: ["Subject1", "Subject2", "Subject3"] }
      ],
      inputValue: ["", "", "", ""]
    };
  }
  componentDidMount() {
    this.handelFocus();
  }
  traggle = (val, event) => {
    const element = event.currentTarget;
    event.persist();
    if (event.target.parentElement === element) {
      let newState = {
        showFilters: false,
        showTopics: false,
        showPopular: false
      };
      newState[val] = !this.state[val];
      this.setState(newState);
    }
  };

  openCheckMenu = event => {
    const element = event.currentTarget;
    element.nextSibling.style.maxHeight = element.children[0].checked
      ? "500px"
      : "0px";
  };

  checkAllMenu = () => {
    this.state.popular.forEach((val, index) => {
      if (index === 0) return;
      let check0 = document.getElementById("check0");
      let el = document.getElementById("check" + index);
      el.checked = check0.checked;
      el.parentNode.nextSibling.style.maxHeight = el.checked ? "500px" : "0px";
      if (val.subject.length > 0) {
        val.subject.forEach((v, i) => {
          let ele = document.getElementById(val.course + "-" + v);
          ele.checked = check0.checked;
        });
      }
    });
  };
  handelFocus = () => {
    const inputArr = document.getElementsByClassName("focus-input");
    const l = inputArr.length;
    const re = /^[0-9./]+$/;
    for (let i = 0; i < l; i++) {
      console.log(inputArr[i].value);
      if (re.test(inputArr[i].value) > 0 && i !== l - 1) {
        // inputArr[i].onblur = null;
        // inputArr[i].disabled = true;
      } else {
        inputArr[i].disabled = false;
        inputArr[i].focus();
        inputArr[i].onblur = function() {
          setTimeout(function() {
            inputArr[i].focus();
          });
        };
        break;
      }
    }
  };
  handelInput = (index, event) => {
    const element = event.currentTarget;
    element.onblur = null;
    element.disabled = true;

    const re = /^[0-9./]+$/;
    if (element.value === "" || re.test(element.value)) {
      let inputValue = this.state.inputValue;
      inputValue[index] = element.value;
      this.setState({ inputValue: inputValue });
    }
    this.handelFocus();
  };
  handelDelete = (index, event) => {
    event.persist();
    console.log("handelDelete");
    console.log(event.currentTarget);
    const inputArr = document.getElementsByClassName("focus-input");
    if (event.key === "Backspace" && event.currentTarget.value === "") {
      const i = index - 1 < 0 ? 0 : index - 1;
      inputArr[index].onblur = null;
      inputArr[index].disabled = true;
      inputArr[i].disabled = false;
      inputArr[i].focus();
      inputArr[i].onblur = function() {
        setTimeout(function() {
          inputArr[i].focus();
        });
      };
    }
    if (event.key === "Enter") {
      inputArr[index].onblur = null;
      this.handelFocus();
    }
  };
  render() {
    const accuracy = (this.state.correct / this.state.completed) * 100;
    let bg = "";
    let na = 0;

    const start = new Date();
    const c = 1;
    if (this.state.startTimer) {
      this.setState({ startTimer: false });
      let timer = setInterval(() => {
        let delta = (new Date() - start) / 5000;

        if (delta >= 1) delta = 1;
        delta = c - delta;
        na = Math.pow(-delta, 3) * accuracy + accuracy;

        if (na >= 50) {
          let deg = -90 + (180 / 50) * (na - 50);
          bg =
            "linear-gradient(" +
            deg +
            "deg,#0b70a8 ,#62afb1 50%,transparent 50%),linear-gradient(-90deg,#62afb1 ,#62afb1 50% ,#878787 50%)";
        } else {
          let deg = -90 + (180 / 50) * na;
          bg =
            "linear-gradient(" +
            deg +
            "deg,#878787 50%,transparent 50%),linear-gradient(-90deg,#0b70a8 ,#62afb1 50% ,#878787 50%)";
        }
        this.setState({ accuracy: na, circleBG: bg });
        if (delta === 0) clearInterval(timer);
      }, 10);
    }

    let topics = this.state.topics.map((val, index) => (
      <div key={index}>{val}</div>
    ));

    let filters = this.state.filters.map((val, index) => (
      <div className="radio-group" key={index}>
        <div className="radio-name">{val.name}</div>

        <div className="radio">
          {val.content.map((v, i) => (
            <div key={i} className="radio-content" onClick={this.setGender}>
              <input type="radio" name={val.name} value={v} />

              <div className="radio-border" />
              <div className="radio-bg" />
              <p>{v}</p>
            </div>
          ))}
        </div>
      </div>
    ));

    let popular = this.state.popular.map((val, index) => {
      let check;
      if (val.subject.length > 0) {
        check = (
          <div className="check-name">
            <label onClick={this.openCheckMenu}>
              <input type="checkbox" id={"check" + index} />
              <span className="checkmark" />
              {val.course}
              <span className="drop-menu" />
            </label>
            <div className="check-menu" data-open="false">
              {val.subject.map((v, i) => (
                <label key={i} htmlFor={val.course + "-" + v}>
                  <input type="checkbox" id={val.course + "-" + v} />
                  <span className="checkmark" />
                  {v}
                </label>
              ))}
            </div>
          </div>
        );
      } else {
        check = (
          <div className="check-name" onClick={this.checkAllMenu}>
            <label>
              <input type="checkbox" id={"check" + index} />
              <span className="checkmark" />
              {val.course}
            </label>
          </div>
        );
      }

      return (
        <div className="check-group" key={index}>
          {check}
        </div>
      );
    });

    let numberList = this.state.inputValue.map((val, index) => {
      return (
        <div className="number-list">
          <input
            className="focus-input"
            required
            maxLength="1"
            placeholder={index + 1}
            onClick={this.handelFocus}
            onChange={this.handelInput.bind(this, index)}
            onKeyDown={this.handelDelete.bind(this, index)}
            value={val}
            disabled={true}
          />
          <div className="number-bg" />
          <div className="number-bd" />
        </div>
      );
    });
    return (
      <div className="App">
        <div className="accuracy">
          <div className="circle" style={{ background: this.state.circleBG }}>
            <div className="circular-text">
              <div className="text">
                <div>
                  <p>ACCURACY</p>
                </div>
                <div className="number">
                  <h1>{this.state.accuracy.toString().slice(0, 4)}</h1>
                  <p>%</p>
                </div>
              </div>
            </div>
          </div>

          <div className="calc">
            <div>COMPLETED</div>
            <div className="problems">
              <h1>{this.state.completed}</h1>
              <p>PROBLEMS</p>
            </div>
          </div>

          <div className="calc">
            <div>CORRECT</div>
            <div className="problems">
              <h1>{this.state.correct}</h1>
              <p>PROBLEMS</p>
            </div>
          </div>
          <div className="footer">PAST 24 HOURS,2020 2/20</div>
        </div>
        <div className="content">
          <div className="top">
            <div className="all-list">
              <div
                className="list"
                onClick={this.traggle.bind(this, "showPopular")}
              >
                <div className="list-border" />
                <div className="list-bg" />
                <p>Popular</p>
                <span className="drop-icon" />

                <div
                  className="popular"
                  style={{ display: this.state.showPopular ? "flex" : "none" }}
                >
                  <span>Popular</span>
                  {popular}
                </div>
              </div>
              <div
                className="list"
                onClick={this.traggle.bind(this, "showTopics")}
              >
                <div className="list-border" />
                <div className="list-bg" />
                <p>Arithmetic</p>
                <span className="drop-icon" />
                <div
                  className="topics"
                  style={{ display: this.state.showTopics ? "flex" : "none" }}
                >
                  <span>TOPICS</span>
                  {topics}
                </div>
              </div>
              <div className="list">
                <div className="list-border" />
                <div className="list-bg" />
                <p>Popular</p>
                <span className="drop-icon" />
              </div>
              <div
                className="list"
                onClick={this.traggle.bind(this, "showFilters")}
              >
                <div className="list-border" />
                <div className="list-bg" />
                <p>More Filters</p>
                <span className="drop-icon" />
                <div
                  className="filters"
                  style={{ display: this.state.showFilters ? "flex" : "none" }}
                >
                  <span>More Filters</span>
                  {filters}
                </div>
              </div>
            </div>
          </div>
          <div className="mid">
            <div className="head">
              <i className="fas fa-calculator" style={{ color: "white" }} />
              <span className="title">Arithmetic Real Problem</span>
              <span className="formula">
                <span className="pi-icon">π</span>
                <p>Formula</p>
              </span>
            </div>
            <div className="body">
              <div className="b-left">
                <img className="analysis-img" src={imgsrc} alt="" />
                <div className="tag">
                  <button>Tag A</button>
                  <button>Tag B</button>
                  <button>Tag C</button>
                </div>
              </div>

              <div className="b-right">
                <div className="input-number">{numberList}</div>
                <div
                  className="press-enter"
                  style={{
                    visibility: this.state.inputValue[0] !== "" ? "" : "hidden"
                  }}
                >
                  <span>Press</span>
                  <span>
                    Enter<i className="material-icons">keyboard_return</i>
                  </span>
                </div>

                <div className="submit">
                  <div className="submit-btn">
                    <div className="skip-bd" />
                    <div className="skip-bg" />
                    <p>Skip</p>
                  </div>
                  <div
                    className="submit-btn"
                    style={{
                      visibility:
                        this.state.inputValue[0] !== "" ? "" : "hidden"
                    }}
                  >
                    <div className="submit-bg" />
                    <p>Submit</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default App;
